import React from 'react';
import '../css/blue-oval-promo.css'

function BlueOval( {word1, word2 } )
{
  return (
    
    <div className='blue-oval-container'>
        <div className='blue-oval-head-text'>
            { word1 }
        </div>
        <div className='blue-oval-head-text'>
            { word1 }
        </div>  
    </div>
  )
}

export default BlueOval;
